import React from "react"
import X from "../images/1.png"
import O from "../images/0.png"

 const BoardElemt = (props)=>
 {
     if(props.el === 1){
        return (            
            <div className="playItem">{X}</div>
        )
     }else if(props.el === 0){
        return (            
            <div className="playItem">{O}</div>
        )
     }else {
        return (            
            <div className="playItem"></div>
        )
     }
        
 }
 
 export default BoardElemt
